import React, {useEffect, useState} from "react";
import axios from 'axios';
import CapitalView from "./CapitalView";

function CapitalComponent(){
    const [capital,setCaptital] = useState(null);

    useEffect(() => {
        axios.get("http://localhost:8080/api/capital").then
        ((response) => setCaptital(response.data)).catch
        ((error)=>console.error("Error al obtener capital",error));
    },[]);

    return (
        capital ? <CapitalView capital={capital.capital} /> : <p className="text-center mt-4">Cargando...</p>
    );
    
}
export default CapitalComponent;
